SELECT p.productName, SUM(od.quantityOrdered) AS total_quantity_ordered FROM products p 
JOIN orderdetails od ON p.productCode = od.productCode 
GROUP BY p.productName;

SELECT c.customerName, MAX(p.paymentDate) AS most_recent_payment_date FROM customers c
JOIN payments p ON c.customerNumber = p.customerNumber
GROUP BY c.customerName;
